import React from 'react';
import { Button, Typography, Grid, AppBar, Toolbar, requirePropFactory} from '@material-ui/core';
import { makeStyles, ThemeProvider} from '@material-ui/core/styles';
import { blue } from '@material-ui/core/colors';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import { defaultProps, propTypes } from 'react-codemirror';
import ProjectCard from './ProjectCard';
import { TabPanel } from '@material-ui/lab';
import { render } from '@testing-library/react';

const Index = (props) => {

    const indexStyles = makeStyles({
        root: {
            color: "white",
            position: "static",
            height: "46px",
            borderRadius: "8px"
        }
    })

    const classes = indexStyles();

    const renderPersonal = () => {

        console.log(props.state)
        return(
            <h1>pers</h1>
        );
    }

    const renderCommunity = () => {

        return(
            <h1 style={{marginTop: '100px'}}>com</h1>
        );
    }

    return(
            <Grid container style={{backgroundColor: "", marginRight: "20px", marginLeft: "20px", marginBottom: "20px", borderRadius: "20px", borderStyle: "solid", borderColor: "black", borderWidth: "5px"}} elevation={3}>
                <AppBar className={classes.root} >
                    <Tabs variant="fullWidth">
                        <Tab label="My codes"/>
                        <Tab label="Community codes"/>
                    </Tabs>
                </AppBar>
                <div>
                    {props.projects.map((project)=> <ProjectCard project={project} style={{height: '400px', width: '250px', marginLeft: '45px', marginRight: '45px', marginTop: '20px', boxShadow: '4'}}/>)}
                </div>
            </Grid>
    );
}

export default Index;
